import { useEffect, useState } from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import {
  ProjectCarousel,
  Footer,
  getNavItems,
  Header,
  Navbar,
} from "../components";
import { getData } from "./getData";

import "./App.scss";

function Home() {
  useState

  useEffect(() => {
    setData(getData());
  }, []);

  return (
    <main className="Home">
      <section className="bio">
        <div>
          <img alt="A photo of Aaron Rine" />
          <p>short quote</p>
        </div>
        <p>intro w/ skills</p>
        <p>mid w/ passion for web dev</p>
        <p>conclusion w/ ways i add value</p>
      </section>
      <ProjectCarousel projects={data.projects} />
      <section className="contact">
        <p>contact</p>
        <a href="https://github.com/aaronrine/">Github</a>
        <a href="https://www.linkedin.com/in/aaron-rine-1903b511a/">LinkedIn</a>
      </section>
    </main>
  );
}

function ProjectDetails() {
  return (
    <main className="ProjectDetails">
      <section>
        <p>problem to solve, approuch to problem, solution</p>
        <ul>
          <li>tech</li>
          <li>stack</li>
        </ul>
        <p>What I learned</p>
        <p>What I liked</p>
        <p>What I disliked</p>
        <a href="https://github.com/aaronrine/todo-list">git demo</a>
      </section>
      <aside>
        <img alt="mobile" />
        <img alt="desktop" />
      </aside>
    </main>
  );
}

const routes = [
  { path: "/", component: Home },
  { path: "/home", component: Home },
  { path: "/projectdetails", component: ProjectDetails },
  { path: "*", component: Home },
];
function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <Navbar navItems={getNavItems()} />
        <Switch>
          {routes.map((route) => (
            <Route exact {...{ ...route }} />
          ))}
        </Switch>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
